import { Backdrop, CircularProgress } from '@mui/material';
import React, { useState } from 'react';
import { Typeahead } from 'react-bootstrap-typeahead';
import { AutoCom } from '../../autoCom';

function SupportResistanceComp() {
    const [loading, setLoading] = useState(false);
    const [stockNum, setStockNum] = useState([]);
    const [inputError, setInputError] = useState(false);
    const [startDate, setStartDate] = useState("");
    const [input3, setInput3] = useState("");

    function submit(e){
        e.preventDefault();
    };

    return (
        <>
            <Backdrop
                sx = {{ color: '#fff', zIndex: (theme) => theme.zIndex.drawer + 1 }}
                open = { loading }
            >
                資料載入中&emsp;
                <CircularProgress color = "inherit" />
            </Backdrop>

            <div className = 'row mx-auto py-3' style = {{ width : "50vw" }}>
                <h3 className = "display-6 text-center">天花板地板線</h3>

                <form onSubmit = { submit }>
                    <div className = 'form-group row'>
                        <label htmlFor = "stockNum_or_Name" className = "col-md-3 col-form-label text-center">股票代號&名稱:&emsp;</label>
                        <div className = 'col-md-3'>
                            <Typeahead
                                id = "stockNum_or_Name"
                                labelKey = "stock_num_name"
                                onChange = { setStockNum }
                                options = { AutoCom.AutoComList }
                                placeholder = "請輸入股票代號或名稱"
                                selected = { stockNum }
                            />
                        </div>

                        <label htmlFor = "date1" className = "col-md-1 col-form-label text-center">歷史資料日期:</label>
                        <div className = 'col-md-2'>
                            <input type = "date" id = "date1" className = "form-control" onChange = {e => setInput2(e.target.value)}></input>
                        </div>

                        <label htmlFor = "date2" className = "col-md-1 col-form-label text-center">到</label>
                        <div className = 'col-md-2'>
                            <input type = "date" id = "date2" className = "form-control" onChange = {e => setInput3(e.target.value)}></input>
                        </div>

                    </div>

                    <div className = 'form-group row py-3'>
                        <div className = 'col-md-12 text-center'>
                            <button type = "submit" className = "btn btn-primary" style = {{ width : "100px" }}>搜尋</button>
                        </div>
                    </div>
                </form>
                { inputError ? <p className = 'text-center' style = {{ color : "red" }}>股票代號&名稱格式錯誤</p> : <></> }
            </div>
        </>
    );
}

export default SupportResistanceComp;
